]=7657,['Z']=69880,['X']=18593,['Contrast']=1,['SizeY']=1200,['Color']=997137,['EffectType']=38,['Alpha']=0.680000,['Pitch']=0,['Roll']=0,['Y']=27440,['SizeX']=1400,['SizeZ']=1200,['Yaw']=2.021091,['Groups']=0,},[17]={['Id']=7658,['Z']=58197,['X']=23033,['Contrast']=1,['SizeY']=4000,['Color']=997900,['EffectType']=829,['Alpha']=1,['Pitch']=1.654572,['Roll']=0,['Y']=24703,['SizeX']=3820,['SizeZ']=4000,['Yaw']=5.579818,['Groups']=0,},[18]={['Id']=7659,['Z']=65193,['Alpha']=1,['X']=26462,['Contrast']=1,['SizeY']=30,['Pitch']=4.625123,['Groups']=0,['Y']=23842,['Color']=102439,['Roll']=0,['MetaData']={['message']='They say to nurture a child\\'s imagination, encourage it to flourish.  Imaginary friends are part of a child\\'s social development they say.   Well, I\\'d never known imaginary friends to leave crystals under a child\\'s pillow!\\n\\n\"My friends gave them to me\", she had insisted.\\n\\nI\\'d never explored beyond the old gate, hidden behind the flowering shrubs.  Tomik said it was safe for our daughter to play there, as there was nothing but old trees and large mushrooms.  \\n\\nThe old gate creaked as I squeezed through.   Wandering up the pathway, falling petals caressed my bare shoulders.  Knots and folds in the old trees could be mistaken for doorways.  I found myself catching lights of magenta, teal, and emerald from the corners of my eyes.  Only to vanish then reappear when I wasn\\'t prepared.  Were they teasing me? \\n\\nThe gentle wind carried soft sounds of child-like giggles.  Joyous.  Playful. \\n\\nCyrstals, like those found under Shalina\\'s pillow, glistened as sun rays reflected from their rough surface.   Satisfied that my dear daughter was not learning the ways of the thief, nor telling lies, I headed back to our cottage.  The old gate creaked it\\'s farewell as I closed it behind me.\\n\\nShalina was watching from her bedroom window as I approached the cottage.  \"Hello darling\", I waved up to her.  \\n\\n\"Mommy, my friends said you visited.\"\\n \"But mommy, for big people, they only come out at night.\"\\n',['title']='They only come out at Night',},['SizeX']=26.456456,['SizeZ']=30,['Yaw']=1.270600,['EffectType']=8503,},[19]={['Id']=7660,['Z']=57388,['X']=22994,['Contrast']=0.680000,['SizeY']=1000,['Color']=999419,['EffectType']=38,['Alpha']=0.420000,['Pitch']=0,['Roll']=0,['Y']=25683,['SizeX']=1000,['SizeZ']=1000,['Yaw']=5.244714,['Groups']=0,},[20]={['Id']=7661,['Z']=63920,['X']=21809,['Contrast']=1,['SizeY']=500,['Color']=996949,['EffectType']=970,['Alpha']=1,['Pitch']=0,['Roll']=0,['Y']=25373,['SizeX']=500,['SizeZ']=500,['Yaw']=4.647812,['Groups']=0,},[21]={['Id']=7662,['Z']=64314,['X']=16388,['Contrast']=1,['SizeY']=500,['Color']=996949,['EffectType']=970,['Alpha']=1,['Pitch']=0,['Roll']=0,['Y']=25097,['SizeX']=500,['SizeZ']=500,['Yaw']=0.900590,['Groups']=0,},[22]={['Id']=7663,['Z']=63573,['X']=23477,['Contrast']=1,['SizeY']=500,['Color']=996949,['EffectType']=970,['Alpha']=1,['Pitch']=0,['Roll']=0,['Y']=25165,['SizeX']=500,['SizeZ']=500,['Yaw']=0.799361,['Groups']=0,},[23]={['Id']=7665,['Z']=67791,['X']=20350,['Contrast']=1,['SizeY']=500,['Color']=996949,['EffectType']=970,['Alpha']=1,['Pitch']=0,['Roll']=0,['Y']=24874,['SizeX']=500,['SizeZ']=500,['Yaw']=2.110103,['Groups']=0,},[24]={['Id']=7667,['Z']=65159,['X']=26462,['Contrast']=1,['SizeY']=202,['Color']=998449,['EffectType']=923,['Alpha']=1,['Pitch']=0,['Roll']=0,['Y']=23876,['SizeX']=202,['SizeZ']=202,['Yaw']=0,['Groups']=0,},[25]={['Id']=7668,['Z']=64915,['X']=26348,['Contrast']=1,['SizeY']=600,['Color']=998449,['EffectType']=923,['Alpha']=1,['Pitch']=0,['Roll']=0,['Y']=24065,['SizeX']=600,['SizeZ']=600,['Yaw']=0,['Groups']=0,},[26]={['Id']=7669,['Z']=70053,['X']=23027,['Contrast']=1,['SizeY']=600,['Color']=998449,['EffectType']=923,['Alpha']=1,['Pitch']=0,['Roll']=0,['Y']=26370,['SizeX']=600,['SizeZ']=600,['Yaw']=0,['Groups']=0,},[27]={['Id']=7670,['Z']=66187,['X']=25931,['Contrast']=1,['SizeY']=600,['Color']=998449,['EffectType']=9